private SolrQueryRequest createRequest(String query) {
  SolrQueryRequest qr = req(query);
  NamedList<Object> par = qr.getParams().toNamedList();
  par.add("debug", "true");
  par.add("rows", "10");
  par.add("fl", "id,node_id,edge_id");
  par.remove("qt");
  SolrParams newp = SolrParams.toSolrParams(par);
  qr.setParams(newp);
  return qr;
}

